function SvgListDisplay(props) {
  return (
    <div className="px-40 py-40 onHover" style={{display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gridGap: '10px', gridAutoRows: '80px', placeItems: "center"}}>
      {data.map((svgItem) => (
        <Icons svgItem={svgItem} key={svgItem.id + Math.random} />
      ))}
    </div>
  );
}

function useInputState(){
  const[inputState, setInputState] = useState("")
  const value = inputState 
  function onChange(event){ 
    return setInputState(event.target.value);

  } 
  return {

    value,
    onChange
  }
}



function svgList(props){

  const titleInputState = useInputState();
 
  const filteredSvg = data.filter(svg => {
    if(svg.title.includes(titleInputState.value)){
      return true;
    }else{
      return false;
    }
  })

  console.log("search value is ", titleInputState.value)

  return(
    <>
    <input {...titleInputState} id="searchInput" className></input>
    </>
  );
}

